// https://leetcode-cn.com/problems/maximum-product-subarray/
// 挑战失败：超出时间限制
#include <cstdio>
#include <vector>
using namespace std;

class Solution {
public:
	int maxProduct(vector<int>& nums) {
		vector<int> a;
		for (int i = 0; i < nums.size();) {
			if (nums[i] == 0) {
				a.push_back(0);
				++i;
				while (i < nums.size() && nums[i] == 0) ++i;
			} else if (nums[i] == 1 || nums[i] == -1) {
				int c = (nums[i] == -1);
				++i;
				while (i < nums.size() && (nums[i] == 1 || nums[i] == -1)) {
					c += (nums[i] == -1);
					++i;
				}
				if (c > 0) {
					a.push_back(-1);
					if (c >= 2) {
						a.push_back(-1);
					}
				} else {
					a.push_back(1);
				}
			} else {
				a.push_back(nums[i]);
				++i;
			}
		}
		int n = a.size();
		bool first = true;
		int start = 0, end = 0;
		int max = 0;
		for (int i = 0; i < n; ++i) {
			for (int j = i; j < n; ++j) {
				int prod = a[i];
				for (int k = i + 1; k <= j; ++k) {
					prod *= a[k];
				}
				if (first || max < prod) {
					max = prod;
					first = false;
					start = i;
					end = j;
				}
			}
		}
		return max;
	}
};

